// src/admin/ContactUs.js
import React from 'react';
import './Admin';
import { useNavigate } from 'react-router-dom';

const ContactUs = () => {
  const navigate = useNavigate();

  const handleNavigate = (path) => {
    navigate(path);
  };

  return (
    <div className="contact-us">
      <div className="navbar">
        <span className="brand" onClick={() => handleNavigate('/admin-home')}>B.Planet</span>
        <div className="nav-links">
          <span className="nav-link" onClick={() => handleNavigate('/contact-us')}>Contact Us</span>
          <span className="nav-link" onClick={() => handleNavigate('/login')}>Login</span>
          <img src="../photos/profile.jpg" alt="Profile" className="profile-pic" onClick={() => handleNavigate('/profile')} />
        </div>
      </div>
      <div className="contact-content">
        <h2>Contact Us</h2>
        <form className="contact-form">
          <label>
            Name:
            <input type="text" name="name" />
          </label>
          <label>
            Email:
            <input type="email" name="email" />
          </label>
          <label>
            Subject:
            <input type="text" name="subject" />
          </label>
          <label>
            Message:
            <textarea name="message"></textarea>
          </label>
          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default ContactUs;
